void PS()
{
	XTime time_start,time_end;
	float layer_1[20]={};
	float layer_2[7]={};
	float layer_3[5]={};
	float layer_4[1]={};
	XTime_SetTime(0);
	XTime_GetTime(&time_start);
	for(int i=0; i<20; i++)
	{
		for(int j=0; j<12288; j++)
		{
			layer_1[i]+=input_data[j]*W1[i][j];
		}
		layer_1[i]+=b1[i];
		if(layer_1[i]<=0)
			layer_1[i]=0;
	}
	for(int i=0; i<7; i++)
	{
		for(int j=0; j<20; j++)
		{
			layer_2[i]+=layer_1[j]*W2[i][j];
		}
		layer_2[i]+=b2[i];
		if(layer_2[i]<=0)
			layer_2[i]=0;
	}
	for(int i=0; i<5; i++)
	{
		for(int j=0; j<7; j++)
		{
			layer_3[i]+=layer_2[j]*W3[i][j];
		}
		layer_3[i]+=b3[i];
		if(layer_3[i]<=0)
			layer_3[i]=0;
	}
	for(int i=0; i<1; i++)
	{
		for(int j=0; j<5; j++)
		{
			layer_4[i]+=layer_3[j]*W4[i][j];
		}
		layer_4[i]+=b4[i];
		layer_4[i] = 1.0/(1.0 + exp(-1*layer_4[i]));
	}
	if(layer_4[0]>0.5)
	{
		layer_4[0]=1;
	}
	else
	{
		layer_4[0]=0;
	}
	XTime_GetTime(&time_end);
	printf("value = %f  \n",layer_4[0]);
	printf("The Execution Time is \n");
	float t = ((float)1.0*(time_end - time_start) / (COUNTS_PER_SECOND/1000000));
	printf("Execution PS - %f \n",t);
}
